    function listmenu($id) {
        $record=array();
        $db = $this->load->database('default', TRUE);
        $sql = "select id_sttsuser as 'id_status',nama,fungtion as 'fungsi'  from menu where id_sttsuser='" . $id . "'";
        $query1 = $db->query($sql);



        foreach ($query1->result_array() as $row) {
            array_push($record, $row);
        }
//        die(0); 
        //uncomment this for liat hasil
        return $record;
    }
