    function generetecode($kd) {
//        print_r($kd);die(0);
        date_default_timezone_set('Asia/Jakarta');
        $date = date('ymd');
        $x = 1;
        if($kd!=''){
        $kodedate = substr($kd, 0, 6);
        $kode = (int)substr($kd, 6, 3);
        }
        if ($kd == '') {
            $hasil = $date . '001';
        } else if ($date = $kodedate) {
            $x = $kode + 1;
            if (strlen($x) == 1) {
                $x = '00' . $x;
            } elseif (strlen($x) == 2) {
                $x = '0' . $x;
            } else {
                $x = $x;
            }

            $hasil = $date . $x;
        } else {
            $hasil = $date . '001';
        }
        return $hasil;

    }
